import { useState } from "react";

const SearchBar = () => {
    let [input, setInput] = useState("")

    return (
        <div className="">
            <input
                className=""
                placeholder="Search for an asset here.."
                value = {input}
                onChange= {(e) => handleSearch(e.target.value)}
            />
        </div>
    )
}

export default SearchBar
